import React from "react";
import { Grid, Header, Segment, Divider, Icon, Image } from "semantic-ui-react";

import image from "../assets/fuji.JPG";

const styles = {
  image: {
    height: "100vh",
    width: "100vw"
  },
  form: { marginTop: "-80vh" }
};
class Contact extends React.Component {
  render() {
    return (
      <div>
        <Image src={image} style={styles.image} fluid />
        <Grid centered columns={4} stackable style={styles.form}>
          <Grid.Column>
            <Header as="h2" textAlign="center">
              You Can Reach Me At:
            </Header>
            <Segment>
              <Header as="h3" textAlign="center" style={{ marginTop: "5%" }}>
                <Icon name="mail" /> Timothy.bell@ttu.edu
              </Header>

              <Divider section />

              <Header as="h3" textAlign="center" style={{ marginTop: "5%" }}>
                <Icon name="facebook" href="" /> Timothy.bell@ttu.edu
              </Header>
              <Header as="h3" textAlign="center" style={{ marginTop: "5%" }}>
                <Icon name="instagram" href="" /> Timothy.bell@ttu.edu
              </Header>
              <Header as="h3" textAlign="center" style={{ marginTop: "5%" }}>
                <Icon name="twitter" href="" /> Timothy.bell@ttu.edu
              </Header>
            </Segment>
          </Grid.Column>
        </Grid>
      </div>
    );
  }
}

export default Contact;
